import React from "react"

export default function Footer() {
    return (
        <footer id="footer">
            <h4 id="formas_pagamento" class="formas_pagamento_txt">Formas de Pagamento</h4>
            <img src="./imagens/formasdepagamento.png" class="formas_pagamento" alt="Formas de Pagamento"/>
            <h4></h4>
        </footer>

    );
}
